    def start_game(self):
        count=1
        self.res.setText('choose x or o')
        ln=[self.l1,self.l2,self.l3,self.l4,self.l5,self.l6,self.l7,self.l8,self.l9]
        lbn = [self.b1, self.b2, self.b3, self.b4, self.b5, self.b6, self.b7, self.b8, self.b9]
        for i in ln:
            i.setText(f'{count}')
            count=count+1
            i.setEnabled(True)
        for b in lbn:
            b.setEnabled(True)
    def click(self,bt):
        if bt.text()=='X':
            self.counter =0
            self.player1()
        elif bt.text()=='O':
            self.counter =1
            self.player1()
        elif bt.text()=='1':
            self.l1.setText(f'{self.player1()}') 
            self.player2()
            self.l1.setEnabled(False)
