    def player1(self):
        self.res.setText('your turn')
        if self.counter==0:
            return 'X'
        else:
            return 'O'
    def player2(self):
        lb = [self.l1, self.l2, self.l3, self.l4, self.l5, self.l6, self.l7, self.l8, self.l9]
        while True:
            cp = random.choice(lb)
            if cp.text()!='X' and cp.text()!='O':
                if self.player1()== 'X':
                    cp.setText('O')
                    break
                else:
                    cp.setText('X')
                    break
            else:
                continue
        self.res.setText('your turn')
    def endgame(self):
        if self.l1.text()!='' and self.l2.text()==self.l1.text() and self.l3.text()==self.l1.text():
            self.res.setText(f'{self.l1.text()} won')
            self.lock()
        elif self.l4.text()!='' and self.l5.text()==self.l4.text() and self.l6.text()==self.l4.text():
            self.res.setText(f'{self.l4.text()} won')
